    "LBA-ECO LC-02 Tributary Coordinates, Acre River, Tri-national River Basin: 2003-2004",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-07-08T19:26:16.629359",nt"name": "lba-eco-lc-02-tributary-coordinates-acre-river-tri-national-river-basin-2003-2004",nt"isopen":
    true,nt"url": null,nt"notes": "This data set provides coordinates for points
    at the mouth of tributaries of the Acre River in the Tri-national River Basin in
    South America. Three Global Positioning System (GPS) readings were made at the outlet
    of each tributary and the average of the three readings is reported. The Tri-national
    River Basin is located in the tri-national frontier region of Madre de Dios, Peru,
    Acre, Brazil, and Pando, Bolivia (known as the MAP region). The MAP region is approximately
    300,000 km2. The Acre River flows through Brazil, Bolivia, and Peru. Data on the
    basin drainage network from the Digital Elevation Model (DEM) Shuttle Radar Topography
    Mission (SRTM) was obtained as a source of information for the border areas. The
    GPS readings were part of an assessment of the reliability of the DEM/SRTM drainage
    network data (Maldonadoae and Brown, 2003). There is one data file in comma-delimited
    (.csv) format and one compamion file (.pdf) with this data set.  DATA QUALITY STATEMENT:
    This data set provides GPS coordinates only and is not associated with any additional
    measurements. There is no associated research documentation. ",nt"license_title":
